tables.table_schema:
CREATE TABLE MemberEligibility (
    member_id INT PRIMARY KEY,
    enrollment_status VARCHAR(50),
    type_of_coverage VARCHAR(50),
    plan_details TEXT
);

CREATE TABLE EnrollmentHistory (
    enrollment_id INT PRIMARY KEY,
    member_id INT,
    enrollment_date DATE,
    termination_date DATE
);

CREATE TABLE Enrollment (
  member_id INT PRIMARY KEY,
  enrollment_status VARCHAR(50),
  type_of_coverage VARCHAR(50),
  plan_details TEXT
);

CREATE TABLE Member (
  member_id INT PRIMARY KEY,
  first_name VARCHAR(50),
  last_name VARCHAR(50),
  date_of_birth DATE
);

CREATE TABLE Plan (
  plan_id INT PRIMARY KEY,
  plan_name VARCHAR(50),
  coverage_description TEXT,
  cost DECIMAL
);

CREATE TABLE MemberEligibility (
    member_id INT PRIMARY KEY,
    enrollment_status VARCHAR(255),
    type_of_coverage VARCHAR(255),
    plan_details TEXT
);

CREATE TABLE EnrollmentStatus (
    status_id INT PRIMARY KEY,
    status_name VARCHAR(255)
);

CREATE TABLE TypeOfCoverage (
    coverage_id INT PRIMARY KEY,
    coverage_name VARCHAR(255)
);

CREATE TABLE PlanDetails (
    plan_id INT PRIMARY KEY,
    plan_name VARCHAR(255),
    plan_description TEXT
);

CREATE TABLE member_eligibility (
    member_id INT PRIMARY KEY,
    enrollment_status VARCHAR(50),
    coverage_type VARCHAR(50),
    plan_details TEXT
);

CREATE TABLE coverage_types (
    type_id INT PRIMARY KEY,
    type_name VARCHAR(50) UNIQUE
);
